import React, { FunctionComponent } from 'react';
import { Parallax, Background } from 'react-parallax';

import './landing.css'

const Landing: FunctionComponent = () => {
    return (
        <Parallax 
            bgImage="images/parallax-1.jpg"
        >

        </Parallax>
    )
}

export default Landing;
